CREATE TABLE [dbo].[HappyData] (
    [Id]          UNIQUEIDENTIFIER DEFAULT (newid()) NOT NULL,
    [storeCode]   VARCHAR (30)     NOT NULL,
    [latitude]    DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [longitude]   DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [temperature] DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [humidity]    DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [anger]       DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [contempt]    DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [disgust]     DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [fear]        DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [happiness]   DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [neutral]     DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [sadness]     DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [surprise]    DECIMAL (10, 6)  DEFAULT ((0)) NOT NULL,
    [inputDate]   SMALLDATETIME    CONSTRAINT [DF_HappyData_inputDate] DEFAULT (getdate()) NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC)
);


